import banner from '../img/Banner-kasa.png';

export const Banner = () => {
  return (
    <div style={{ 
      backgroundImage: `url(${banner})`, 
      backgroundSize: 'cover', 
      backgroundPosition: 'center', 
      backgroundRepeat: 'no-repeat',
      color: 'white'
    }}>
      <p>Chez vous, partout et ailleurs</p>
    </div>
  );
}
